pragma solidity ^0.5.0;

import "./oraclizeAPI.sol";

contract Urltest is usingOraclize {
    uint public price;
    event Log(string text);
    constructor() public{

    }

    function _callback( bytes32 _myid, string memory _result) public{
        require(msg.sender == oraclize_cbAddress());
        emit Log(_result);
        price =   parseInt(_result,2);
    }

    function update() public payable{
        oraclize_query("URL","json(https://min-api.cryptocompare.com/data/price?fsym=ETH&tsyms=USD).USD");
    }
}
